import React from "react";
import "./header.css";

export default function Header() {
  return (
    <div
      className="Header position-fixed w-100 t-0 d-flex align-items-center justify-content-center "
      style={{
        padding: "3rem 10rem",
        fontSize: "1.6rem",
        backgroundColor: "#1d1d26",
      }}
    >
      <a className="logo" href="http://">
        <div className="logo__text">todo</div>
      </a>
      <div className="header__buttons">
        <button
          href="svsdv"
          className="header__button button btn--none-border btn--hover-bb"
        >
          Sign in
        </button>
        <button
          href="sdvsdv"
          className="header__button button btn--border btn--hover-border"
        >
          Sign up
        </button>
      </div>
    </div>
  );
}
